package com.list.programs;

public class ConditionalTrueIf {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=10, a=20;
		
		if(i<a) {
			System.out.println("welcome to first if");
		}
		
		if(i<=a) {
			System.out.println("welcome to second if");
		}
		if(i!=a) {
			System.out.println("welcome to third if");
		}

		if(a>i) {
			System.out.println("welcome to fourth if");
		}

	}

}
